@JacquiLambie Thanks for sharing the results &amp; your thoughts. 

When I was stuck overseas for several months this year away from my family, being able to talk to loved ones by video on my phone really helped my mental health during this stressful time. 

They’re people with families too.

@kidkerrigan @smithymayo That's definitely the dilemma. 

At the moment, as the space changes, platforms should be utilised based on a balance of ROI + genuine enjoyment (mental health in content creation is very important). 

Allocate time into platform content based off that.
